import { BrowserRouter as Router, Route } from "react-router-dom"
import ListItem from "./listItem"

export default function RenderListTest(props) {
  let container = []

  if (!props.type['highlighted'] && !props.data['display']['nonehighlighted']) return <div></div>

  for (let i = 0; i < props.page; i++) {
    if (!props.item[i]) break
    container.push(props.item[i])
  }

  container.map((item, i) => {
    console.log(item)
  })

  if (props.type) {
    return container.map((item, i) => (
      <Router>
        <Route path="www.google.com">
          <ListItem key={`${props.type}${i}D`} item1={item[0].data} item2={item[1].data} item3={item[2].data} item4={item[3].data} item5={item[4].data} item6={item[5].data}/>
        </Route>
      </Router>
    ))
  }
}
